(3, '1', '9', '{\"access_token\": \"YxAl4cTmKSdX9EW\", \"model_version\": \"plant_id:3.7.0\", \"custom_id\": null, \"input\": {\"latitude\": null, \"longitude\": null, \"health\": \"all\", \"images\": [\"https://plant.id/media/imgs/e2e3258d6e474a7f8bd3572e2982ada8.jpg\"], \"datetime\": \"2024-04-12T11:14:46.729561+00:00\"}, \"result\": {\"is_healthy\": {\"binary\": false, \"threshold\": 0.525, \"probability\": 0.3234442472457886}, \"is_plant\": {\"probability\": 1.0, \"threshold\": 0.5, \"binary\": true}, \"classification\": {\"suggestions\": [{\"id\": \"5952b467bb036435\", \"name\": \"Zamioculcas zamiifolia\", \"probability\": 0.9197, \"details\": {\"common_names\": [\"Zanzibar gem\", \"zeezee plant\", \"ZZ Plant\"], \"taxonomy\": {\"class\": \"Liliopsida\", \"genus\": \"Zamioculcas\", \"order\": \"Alismatales\", \"family\": \"Araceae\", \"phylum\": \"Tracheophyta\", \"kingdom\": \"Plantae\"}, \"url\": \"https://en.wikipedia.org/wiki/Zamioculcas\", \"gbif_id\": 2869014, \"inaturalist_id\": 367277, \"rank\": \"species\", \"description\": {\"value\": \"Zamioculcas is genus of flowering plants in the family Araceae, containing the single species Zamioculcas zamiifolia. It is a tropical perennial plant, native to eastern Africa, from southern Kenya to northeastern South Africa. Common names include Zanzibar gem, ZZ plant, Zuzu plant, aroid palm, eternity plant and emerald palm. It is grown as an ornamental plant, mainly for its attractive glossy foliage and easy care.\\nDutch nurseries started wide-scale, commercial propagation of the plant around 1996. It was first described as Caladium zamiifolium by Loddiges in 1829, but moved to his new genus Zamioculcas by Heinrich Wilhelm Schott and given its established name, Zamioculcas zamiifolia, by Adolf Engler.\\nThe roots of the plants are rhizomatous and have the ability to store moisture, thus aiding the plants in their drought resistance. For this reason, the plant should be watered only when it is dry, to avoid overwatering. A commonly-held notion among gardeners is \\u201cIf you water the ZZ plant more than you pay your rent, it\\u2019s too much\\u201d  (I.e.; once a month, possibly twice, watering is more than sufficient). They also require superior drainage, with lots of chunky, rocky and inert materials mixed into their soil. They\\u2019re known to survive in relatively dark, indoor areas of homes and buildings, and can live in full shade to indirect sunlight. However, lower light is not optimal in most cases; insufficient amounts of sunlight can result in leaves lengthening and/or falling off, yellowing (chlorosis), and generally uneven or disproportionate growth (as the plant stretches towards a light source).\", \"citation\": \"https://en.wikipedia.org/wiki/Zamioculcas\", \"license_name\": \"CC BY-SA 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/3.0/\"}, \"synonyms\": [\"Caladium zamiifolium\", \"Zamioculcas lanceolata\", \"Zamioculcas loddigesii\"], \"image\": {\"value\": \"https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/59a/59a39aeb120d4e08b63bd07b53440d5354c6ed4f.jpg\", \"citation\": \"//commons.wikimedia.org/wiki/User:WeFt\", \"license_name\": \"CC BY-SA 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/3.0/\"}, \"edible_parts\": null, \"watering\": {\"max\": 2, \"min\": 2}, \"language\": \"en\", \"entity_id\": \"5952b467bb036435\"}}, {\"id\": \"21f72cae8ac50309\", \"name\": \"Kalanchoe delagoensis\", \"probability\": 0.0117, \"details\": {\"common_names\": [\"chandelier plant\", \"Mother of Thousands\", \"Mother of Millions\", \"Lizard Plant\", \"Mother-of-Millions\"], \"taxonomy\": {\"class\": \"Magnoliopsida\", \"genus\": \"Kalanchoe\", \"order\": \"Saxifragales\", \"family\": \"Crassulaceae\", \"phylum\": \"Tracheophyta\", \"kingdom\": \"Plantae\"}, \"url\": \"https://en.wikipedia.org/wiki/Kalanchoe_delagoensis\", \"gbif_id\": 2985940, \"inaturalist_id\": 164328, \"rank\": \"species\", \"description\": {\"value\": \"Kalanchoe delagoensis, formerly known as Bryophyllum delagoense and commonly called mother of millions or chandelier plant, is a succulent plant native to Madagascar. Like other members of Bryophyllum (now included in Kalanchoe), it is able to propagate vegetatively from plantlets that develop on its leaf margins.\", \"citation\": \"https://en.wikipedia.org/wiki/Kalanchoe_delagoensis\", \"license_name\": \"CC BY-SA 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/3.0/\"}, \"synonyms\": [\"Bryophyllum delagoense\", \"Bryophyllum delagoensis\", \"Bryophyllum tubiflorum\", \"Bryophyllum tubiflorum Harv., 1962\", \"Bryophyllum verticillatum\", \"Geaya purpurea\", \"Kalanchoe tuberosa\", \"Kalanchoe tubiflora\", \"Kalanchoe verticillata\"], \"image\": {\"value\": \"https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/2c4/2c4bbdd09156402da5810edcd29e424ea3d8d998.jpg\", \"citation\": \"//commons.wikimedia.org/wiki/User:Das_Nili\", \"license_name\": \"CC BY-SA 2.5\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/2.5/\"}, \"edible_parts\": null, \"watering\": {\"max\": 1, \"min\": 1}, \"language\": \"en\", \"entity_id\": \"21f72cae8ac50309\"}}, {\"id\": \"cc31c6d36937ffd1\", \"name\": \"Hoya carnosa\", \"probability\": 0.0101, \"details\": {\"common_names\": [\"porcelainflower\", \"wax plant\", \"Common Wax-plant\"], \"taxonomy\": {\"class\": \"Magnoliopsida\", \"genus\": \"Hoya\", \"order\": \"Gentianales\", \"family\": \"Apocynaceae\", \"phylum\": \"Tracheophyta\", \"kingdom\": \"Plantae\"}, \"url\": \"https://en.wikipedia.org/wiki/Hoya_carnosa\", \"gbif_id\": 8658195, \"inaturalist_id\": 129523, \"rank\": \"species\", \"description\": {\"value\": \"Hoya carnosa, the porcelainflower or wax plant, is a species of flowering plant in the dogbane family Apocynaceae. It is one of the many species of Hoya that are native to Eastern Asia and Australia. It is a common house plant grown for its attractive waxy foliage, and sweetly scented flowers. It is grown well in pots and hanging baskets.\\nHoya carnosa has been in cultivation for more than 200 years and has given rise to many cultivars that vary in foliage form or flower color. In cultivation in the UK it has gained the Royal Horticultural Society\'s Award of Garden Merit.\", \"citation\": \"https://en.wikipedia.org/wiki/Hoya_carnosa\", \"license_name\": \"CC BY-SA 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/3.0/\"}, \"synonyms\": [\"Asclepias carnosa\", \"Cynanchum carnosum\", \"Hoya carnosa f. variegata\", \"Hoya carnosa foliis-variegata\", \"Hoya carnosa var. carnosa\", \"Hoya carnosa var. formosana\", \"Hoya carnosa var. gushanica\", \"Hoya carnosa var. japonica\", \"Hoya carnosa var. variegata\", \"Hoya chinensis\", \"Hoya compacta\", \"Hoya crassifolia\", \"Hoya formosana\", \"Hoya intermedia\", \"Hoya laurifolia\", \"Hoya motoshei\", \"Hoya motoskei\", \"Hoya picta\", \"Hoya rotundifolia\", \"Hoya skinneriana\", \"Hoya variegata\", \"Schollia carnosa\", \"Schollia chinensis\", \"Schollia crassifolia\", \"Stapelia chinensis\"], \"image\": {\"value\": \"https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/139/13991341c5303e7fe5834d027719c1d92a01c822.jpg\", \"citation\": \"//commons.wikimedia.org/w/index.php?title=User:Yvan_leduc_(UED187480)&action=edit&redlink=1\", \"license_name\": \"CC BY-SA 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/3.0/\"}, \"edible_parts\": null, \"watering\": {\"max\": 2, \"min\": 2}, \"language\": \"en\", \"entity_id\": \"cc31c6d36937ffd1\"}}]}, \"disease\": {\"suggestions\": [{\"id\": \"e5eed7f688efa59e\", \"name\": \"water excess or uneven watering\", \"probability\": 0.2636, \"details\": {\"description\": \"Water excess and uneven watering are abiotic disorders caused by inadequate watering. Water excess may lead to rotting of the roots due to lack of oxygen, and higher susceptibility to infection. Symptoms of over-watering include stunted growth, yellow and brown leaves, wilting and higher susceptibility to leaf burn.\", \"url\": \"https://www.missouribotanicalgarden.org/gardens-gardening/your-garden/help-for-the-home-gardener/advice-tips-resources/pests-and-problems/environmental/overwatering.aspx\", \"common_names\": [\"overwatering\"], \"language\": \"en\", \"entity_id\": \"e5eed7f688efa59e\"}}, {\"id\": \"d24ebab7c0155e4b\", \"name\": \"Animalia\", \"probability\": 0.2151, \"redundant\": true, \"details\": {\"description\": \"Disorders induced by organisms from the animal kingdom. These pests cause direct damage by feeding on leaves, stems, roots, and other parts of the plant or by inhabiting plant tissues. Pests can also spread bacterial and viral diseases.\", \"url\": \"https://en.wikipedia.org/wiki/Animal\", \"common_names\": [\"pests\"], \"language\": \"en\", \"entity_id\": \"d24ebab7c0155e4b\"}}, {\"id\": \"76e471140b1b55e2\", \"name\": \"Insecta\", \"probability\": 0.1878, \"redundant\": true, \"details\": {\"description\": \"Class Insecta contains many major plant pests such as aphids and thrips. Damage can be caused by both larval and adult stages. They can cause feeding damage or transmit a bacterial, viral, or fungal infection.\", \"url\": \"https://en.wikipedia.org/wiki/Insect\", \"common_names\": [\"insects\"], \"language\": \"en\", \"entity_id\": \"76e471140b1b55e2\"}}, {\"id\": \"53aac959aba8302b\", \"name\": \"mechanical damage\", \"probability\": 0.1169, \"details\": {\"description\": \"Mechanical damage occurs when parts of the plant are disrupted by physical action, usually by tools or inappropriate handling. The wound can be an entry point for infectious disease or it can disrupt the water and nutrient transport.\", \"url\": \"https://www.missouribotanicalgarden.org/gardens-gardening/your-garden/help-for-the-home-gardener/advice-tips-resources/pests-and-problems/environmental/mechanical.aspx\", \"common_names\": [\"mechanical injury\"], \"language\": \"en\", \"entity_id\": \"53aac959aba8302b\"}}, {\"id\": \"bf75abeaaafd6c6f\", \"name\": \"feeding damage by insects\", \"probability\": 0.1166, \"details\": {\"description\": \"Feeding damage by insects includes holes or notches in leaves, removal of the tissue between leaf veins, tunnels in the plant tissue, root consumption, and others.\", \"url\": \"https://gardeningsolutions.ifas.ufl.edu/care/pests-and-diseases/pests/management/different-pests-different-damage.html\", \"common_names\": null, \"language\": \"en\", \"entity_id\": \"bf75abeaaafd6c6f\"}}, {\"id\": \"765b06482c4e4ae9\", \"name\": \"nutrient deficiency\", \"probability\": 0.1106, \"details\": {\"description\": \"Nutrient deficiency is caused by a lack of macronutrients or micronutrients essential for the plant. This can be caused by insufficient amounts of nutrients in the soil or unsuitable conditions for nutrients uptake.\", \"url\": \"https://www.missouribotanicalgarden.org/gardens-gardening/your-garden/help-for-the-home-gardener/advice-tips-resources/pests-and-problems/environmental/nutrients.aspx\", \"common_names\": null, \"language\": \"en\", \"entity_id\": \"765b06482c4e4ae9\"}}, {\"id\": \"9218257b5a5f1180\", \"name\": \"lack of light\", \"probability\": 0.0969, \"details\": {\"description\": \"Lack of light may lead to a leggy and weak appearance of the plant. Such plants often grow long internodes with smaller leaves, have stunted growth or the leaves become yellow.\", \"url\": \"https://extension.umn.edu/planting-and-growing-guides/lighting-indoor-plants\", \"common_names\": [\"light deficiency\"], \"language\": \"en\", \"entity_id\": \"9218257b5a5f1180\"}}]}}, \"status\": \"COMPLETED\", \"sla_compliant_client\": true, \"sla_compliant_system\": true, \"created\": 1712920486.729561, \"completed\": 1712920487.626354}', 1, '2024-04-12 03:14:48', '2024-04-12 03:14:48'),
(4, '1', '12', '{\"access_token\": \"jWGmFjzZW1jqbQB\", \"model_version\": \"plant_id:3.7.0\", \"custom_id\": null, \"input\": {\"latitude\": null, \"longitude\": null, \"health\": \"all\", \"images\": [\"https://plant.id/media/imgs/3a2c4c99a4084f7db4320b4a35c577f6.jpg\"], \"datetime\": \"2024-04-15T16:14:11.111861+00:00\"}, \"result\": {\"is_healthy\": {\"binary\": false, \"threshold\": 0.525, \"probability\": 0.03125542402267456}, \"is_plant\": {\"probability\": 0.9972256, \"threshold\": 0.5, \"binary\": true}, \"classification\": {\"suggestions\": [{\"id\": \"87a7e46006c1151b\", \"name\": \"Chlorophytum comosum\", \"probability\": 0.8637, \"details\": {\"common_names\": [\"Walking Anthericum\", \"Spider plant\", \"Bracket plant\", \"Hen-and-Chicks\", \"Green Hen And Chickens\", \"Hen And Chickens\", \"Hen-And-Chickens\", \"Ribbon Plant\", \"Spider Ivy\"], \"taxonomy\": {\"class\": \"Liliopsida\", \"genus\": \"Chlorophytum\", \"order\": \"Asparagales\", \"family\": \"Asparagaceae\", \"phylum\": \"Tracheophyta\", \"kingdom\": \"Plantae\"}, \"url\": \"https://en.wikipedia.org/wiki/Chlorophytum_comosum\", \"gbif_id\": 2774846, \"inaturalist_id\": 322492, \"rank\": \"species\", \"description\": {\"value\": \"Chlorophytum comosum, usually called spider plant or common spider plant due to its spider-like look, also known as spider ivy, ribbon plant (a name it shares with Dracaena sanderiana), and hen and chickens is a species of evergreen perennial flowering plant of the family Asparagaceae. It is native to tropical and Southern Africa but has become naturalized in other parts of the world, including Western Australia and Bangladesh. Chlorophytum comosum is easy to grow as a houseplant because of its resilience, but it can be sensitive to the fluoride in tap water, which commonly gives it \\\"burnt tips\\\". Variegated forms are the most popular.\", \"citation\": \"https://en.wikipedia.org/wiki/Chlorophytum_comosum\", \"license_name\": \"CC BY-SA 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/3.0/\"}, \"synonyms\": [\"Anthericum comosum\", \"Anthericum longituberosum\", \"Anthericum picturatum\", \"Anthericum sternbergianum\", \"Anthericum vallis-trappii\", \"Anthericum variegatum\", \"Anthericum vittatum\", \"Anthericum vittatum variegatum\", \"Anthericum williamsii\", \"Caesia comosa\", \"Chlorophytum brevipes\", \"Chlorophytum bukobense\", \"Chlorophytum bukobense subsp. kilimandscharicum\", \"Chlorophytum bukobense var. kilimandscharicum\", \"Chlorophytum burchellii\", \"Chlorophytum delagoense\", \"Chlorophytum elatulum\", \"Chlorophytum elgonense\", \"Chlorophytum gazense\", \"Chlorophytum glaucidulum\", \"Chlorophytum glaucidulum subsp. pauper\", \"Chlorophytum glaucidulum var. pauper\", \"Chlorophytum inopinum\", \"Chlorophytum kirkii\", \"Chlorophytum limurense\", \"Chlorophytum longum\", \"Chlorophytum magnum\", \"Chlorophytum miserum\", \"Chlorophytum nemorosum\", \"Chlorophytum paludicola\", \"Chlorophytum ramiferum\", \"Chlorophytum rugosum\", \"Chlorophytum sternbergianum\", \"Chlorophytum turritum\", \"Chlorophytum usambarense\", \"Cordyline vivipara\", \"Hartwegia comosa\", \"Hollia comosa\", \"Narthecium sarmentosum\", \"Phalangium comosum\", \"Phalangium viviparum\"], \"image\": {\"value\": \"https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/1c1/1c139094cf352af0477660ec5d5aec39e57de3ca.jpg\", \"citation\": \"//commons.wikimedia.org/wiki/User:Juan_Carlos_Fonseca_Mata\", \"license_name\": \"CC BY-SA 4.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/4.0/\"}, \"edible_parts\": null, \"watering\": {\"max\": 2, \"min\": 2}, \"language\": \"en\", \"entity_id\": \"87a7e46006c1151b\"}}, {\"id\": \"26976e342980c5b8\", \"name\": \"Dracaena\", \"probability\": 0.1221, \"details\": {\"common_names\": [\"Dragon trees\"], \"taxonomy\": {\"class\": \"Liliopsida\", \"genus\": \"Dracaena\", \"order\": \"Asparagales\", \"family\": \"Asparagaceae\", \"phylum\": \"Tracheophyta\", \"kingdom\": \"Plantae\"}, \"url\": \"https://en.wikipedia.org/wiki/Dracaena_(plant)\", \"gbif_id\": 2752062, \"inaturalist_id\": 124826, \"rank\": \"genus\", \"description\": {\"value\": \"Dracaena () is a genus of about 120 species of trees and succulent shrubs.  The formerly accepted genera Pleomele and  Sansevieria are now included in Dracaena. In the APG IV classification system, it is placed in the family Asparagaceae, subfamily Nolinoideae (formerly the family Ruscaceae). It has also formerly been separated (sometimes with Cordyline) into the family Dracaenaceae or placed in the Agavaceae (now Agavoideae).\\nThe name dracaena is derived from the romanized form of the Ancient Greek \\u03b4\\u03c1\\u03ac\\u03ba\\u03b1\\u03b9\\u03bd\\u03b1 \\u2013 drakaina, \\\"female dragon\\\".The majority of the species are native to Africa, southern Asia through to northern Australia, with two species in tropical Central America.\", \"citation\": \"https://en.wikipedia.org/wiki/Dracaena_(plant)\", \"license_name\": \"CC BY-SA 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/3.0/\"}, \"synonyms\": [\"Acyntha\", \"Chrysodracon\", \"Draco\", \"Drakaina\", \"Nemampsis\", \"Oedera\", \"Pleomele\", \"Salmia\", \"Sanseverinia\", \"Sansevieria\", \"Stoerkia\", \"Terminalis\"], \"image\": {\"value\": \"https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/64d/64d071834af63c6cd9465e3113de9253c7ddd605.jpg\", \"citation\": \"https://commons.wikimedia.org/wiki/File:Dracaena_draco.jpg\", \"license_name\": \"CC BY-SA 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by-sa/3.0/\"}, \"edible_parts\": null, \"watering\": {\"max\": 2, \"min\": 1}, \"language\": \"en\", \"entity_id\": \"26976e342980c5b8\"}}, {\"id\": \"b570d8960493cfee\", \"name\": \"Chlorophytum capense\", \"probability\": 0.0141, \"details\": {\"common_names\": [\"bracketplant\"], \"taxonomy\": {\"class\": \"Liliopsida\", \"genus\": \"Chlorophytum\", \"order\": \"Asparagales\", \"family\": \"Asparagaceae\", \"phylum\": \"Tracheophyta\", \"kingdom\": \"Plantae\"}, \"url\": \"https://www.gbif.org/species/2774721\", \"gbif_id\": 2774721, \"inaturalist_id\": 82363, \"rank\": \"species\", \"description\": null, \"synonyms\": [\"Anthericum elatum\", \"Anthericum fastigiatum\", \"Anthericum rouwenortii\", \"Anthericum variegatum\", \"Asphodelus capensis\", \"Chlorophytum elatum\", \"Phalangium elatum\", \"Phalangium fasciculatum\", \"Phalangium fastigiatum\", \"Phalangium variegatum\"], \"image\": {\"value\": \"https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/a04/a049ef3180d9045b749b204c1f5750654855e6bf.jpg\", \"citation\": \"//commons.wikimedia.org/wiki/User:Gangulybiswarup\", \"license_name\": \"CC BY 3.0\", \"license_url\": \"https://creativecommons.org/licenses/by/3.0/\"}, \"edible_parts\": null, \"watering\": null, \"language\": \"en\", \"entity_id\": \"b570d8960493cfee\"}}]}, \"disease\": {\"suggestions\": [{\"id\": \"e5eed7f688efa59e\", \"name\": \"water excess or uneven watering\", \"probability\": 0.513, \"details\": {\"description\": \"Water excess and uneven watering are abiotic disorders caused by inadequate watering. Water excess may lead to rotting of the roots due to lack of oxygen, and higher susceptibility to infection. Symptoms of over-watering include stunted growth, yellow and brown leaves, wilting and higher susceptibility to leaf burn.\", \"url\": \"https://www.missouribotanicalgarden.org/gardens-gardening/your-garden/help-for-the-home-gardener/advice-tips-resources/pests-and-problems/environmental/overwatering.aspx\", \"common_names\": [\"overwatering\"], \"language\": \"en\", \"entity_id\": \"e5eed7f688efa59e\"}}, {\"id\": \"c6fbc333b227bd54\", \"name\": \"water deficiency\", \"probability\": 0.2299, \"details\": {\"description\": \"Water deficiency is similar in its symptoms to over-watering and it is important to identify the cause. Symptoms include slow growth, wilting, discolored leaves and flowers, burning on edges of leaves. The affected plant can also suffer from disrupted nutrient uptake.\", \"url\": \"https://www.missouribotanicalgarden.org/gardens-gardening/your-garden/help-for-the-home-gardener/advice-tips-resources/pests-and-problems/environmental/drought.aspx\", \"common_names\": [\"drought\"], \"language\": \"en\", \"entity_id\": \"c6fbc333b227bd54\"}}, {\"id\": \"53aac959aba8302b\", \"name\": \"mechanical damage\", \"probability\": 0.2183, \"details\": {\"description\": \"Mechanical damage occurs when parts of the plant are disrupted by physical action, usually by tools or inappropriate handling. The wound can be an entry point for infectious disease or it can disrupt the water and nutrient transport.\", \"url\": \"https://www.missouribotanicalgarden.org/gardens-gardening/your-garden/help-for-the-home-gardener/advice-tips-resources/pests-and-problems/environmental/mechanical.aspx\", \"common_names\": [\"mechanical injury\"], \"language\": \"en\", \"entity_id\": \"53aac959aba8302b\"}}, {\"id\": \"765b06482c4e4ae9\", \"name\": \"nutrient deficiency\", \"probability\": 0.1525, \"details\": {\"description\": \"Nutrient deficiency is caused by a lack of macronutrients or micronutrients essential for the plant. This can be caused by insufficient amounts of nutrients in the soil or unsuitable conditions for nutrients uptake.\", \"url\": \"https://www.missouribotanicalgarden.org/gardens-gardening/your-garden/help-for-the-home-gardener/advice-tips-resources/pests-and-problems/environmental/nutrients.aspx\", \"common_names\": null, \"language\": \"en\", \"entity_id\": \"765b06482c4e4ae9\"}}, {\"id\": \"af7b78782de52bd8\", \"name\": \"senescence\", \"probability\": 0.0929, \"details\": {\"description\": \"Senescence is a process of aging that can occur due to physiological aging or environmental stress.\", \"url\": \"https://en.wikipedia.org/wiki/Plant_senescence\", \"common_names\": [\"aging\"], \"language\": \"en\", \"entity_id\": \"af7b78782de52bd8\"}}, {\"id\": \"dbdc1966896977dd\", \"name\": \"light excess\", \"probability\": 0.0329, \"details\": {\"description\": \"Too much light can be harmful, especially to shade-loving plants. The excess light energy is converted to heat and can cause damage to the plant. The plant develops symptoms such as yellow or brown spots on the foliage, yellowing of the leaves, brown crispy leaf edges or tips, and wilting. In serious cases, excess light leads to sunburn or sunscald.\", \"url\": null, \"common_names\": null, \"language\": \"en\", \"entity_id\": \"dbdc1966896977dd\"}}]}}, \"status\": \"COMPLETED\", \"sla_compliant_client\": true, \"sla_compliant_system\": true, \"created\": 1713197651.111861, \"completed\": 1713197651.973105}', 1, '2024-04-15 08:14:13', '2024-04-15 08:14:13');
